import React from 'react';
import linkedin from '../../Assets/linkedIn.svg';
import facebook from '../../Assets/facebook.svg';
import github from '../../Assets/github.svg';
import resume from '../../Assets/resume.svg';
import html from '../../Assets/webResume.txt'

const MyCard = () =>{

  const getResume =()=>{
    let
    childUrl = window.open('/preview', '_blank');
    childUrl.document.open('src/Assets/resumeWeb.html');
    childUrl.document.write(`${html}`)
  };

    return (
      <div className={'myCard'}>
        <i className="fab fa-linkedin"> </i>
        <ul className={'card'}>
          <li className={'social'}>LinkedIn <a href={'https://www.linkedin.com/'} target="_blank"><img className={'socialIcon'} width={'20%'} src={linkedin} alt={'linkedin'}/> </a></li>
          <li className={'social'}>FaceBook <a href={'https://www.facebook.com/'} target="_blank"><img className={'socialIcon'} width={'40%'} src={facebook} alt={'facebook'}/> </a></li>
          <li className={'social'}>GitHub <a href={'https://www.github.com/'} target="_blank"><img className={'socialIcon'}  width={'40%'} src={github} alt={'git'}/> </a></li>
          <li> </li>
          <li>Resume <img className={'socialIcon'} onClick={() => getResume()} width={'40%'} src={resume} alt={'resume'}/></li>
        </ul>
      </div>
    );
};

export default MyCard;
